   [120]={next_id=121, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="但是没有父母的孩子，在孩子们的社会中就是“异类”，而排除异己是人类的天性。", msg_color="", msg_size=0, talker="梅鹿特", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4502", 0, 0, -129.5, 214.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [121]={next_id=122, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="能想象到，所以梅鹿特在学校里没少被欺负？", msg_color="", msg_size=0, talker="玩家名字", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4502", 0, 0, -129.5, 214.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,0}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [122]={next_id=123, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="不过也没有那么惨，我可是神枪手呢，我做了一把小型弹弓，谁敢欺负我，我就射的他们满头是包！", msg_color="", msg_size=0, talker="梅鹿特", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4502", 0, 0, -129.5, 214.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [123]={next_id=124, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="梅鹿特握拳空挥，漂亮的眼睛里似有火星闪烁。", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [124]={next_id=125, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="但这不代表我不想爸爸妈妈，直到十二岁之前，我都只能从一些小时候模糊的记忆和寥寥几封书信中了解我的父母。", msg_color="", msg_size=0, talker="梅鹿特", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4502", 0, 0, -129.5, 214.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [125]={next_id=126, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="阿姨有一个女儿，她一直不喜欢我，觉得我抢走了她的妈妈。", msg_color="", msg_size=0, talker="梅鹿特", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4502", 0, 0, -129.5, 214.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [126]={next_id=127, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="阿姨的女儿说我的父母早就死了，那些信件都是阿姨代写的。", msg_color="", msg_size=0, talker="梅鹿特", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4502", 0, 0, -129.5, 214.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [127]={next_id=128, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="我当时立刻就反驳了回去，我还嘲笑了她的嫉妒心，我们差点就打了起来。", msg_color="", msg_size=0, talker="梅鹿特", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4502", 0, 0, -129.5, 214.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [128]={next_id=129, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="怀疑的种子一旦种下了就会萌芽，链尉官。我从小到大都没见过爸爸妈妈，我很害怕这一切都只是一场泡影。", msg_color="", msg_size=0, talker="梅鹿特", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4502", 0, 0, -129.5, 214.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [129]={next_id=130, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="所以我……", msg_color="", msg_size=0, talker="梅鹿特", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4502", 0, 0, -129.5, 214.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [130]={next_id=131, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="那分朝气迅速退去，梅鹿特露出了看到闯祸的小孩子一样害怕的表情。", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [131]={next_id=132, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="你知道眼前的女孩正尝试面对自己最恐惧、最难以启齿的过去，她需要的是支持，是一份迫在眉睫的鼓励。", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [132]={next_id=133, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="嗯，说吧，我会听着的。", msg_color="", msg_size=0, talker="玩家名字", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [133]={next_id=134, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="梅鹿特感受到了你的心意，她坐起身，回应着你的视线。", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [134]={next_id=135, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="我……偷听了阿姨和她女儿的谈话。", msg_color="", msg_size=0, talker="梅鹿特", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4502", 0, 0, -129.5, 214.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [135]={next_id=136, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="哦，我想那一定不是什么很愉快的事情。", msg_color="", msg_size=0, talker="玩家名字", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4502", 0, 0, -129.5, 214.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,0}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [136]={next_id=137, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="“傻孩子，妈妈最爱的当然是你！你和一个孤儿计较什么呢？如果不是当初为了她父母的抚恤金，妈妈也不会收养她。”", msg_color="", msg_size=0, talker="梅鹿特", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4502", 0, 0, -129.5, 214.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [137]={next_id=138, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="梅鹿特一字一顿地说出了这句话，每吐出一个 字都能感受到她压抑在嗓子里的波涛汹涌的情绪。", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4502", 0, 0, -129.5, 214.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [138]={next_id=139, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="我已经记不得我是怎么离开那里的了，链尉官。", msg_color="", msg_size=0, talker="梅鹿特", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4502", 0, 0, -129.5, 214.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [139]={next_id=140, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="我只感觉，从那一天开始，我的周围被一片漆黑包围，没有一丝光亮，没有一丝温暖，回应我的只有冰冷的虚无。", msg_color="", msg_size=0, talker="梅鹿特", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4502", 0, 0, -129.5, 214.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [140]={next_id=141, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="阿姨对我很好，真的很好，我直到我没有任何资格去埋怨阿，她只是为了安抚自己的女儿才说了那些话。", msg_color="", msg_size=0, talker="梅鹿特", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4502", 0, 0, -129.5, 214.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [141]={next_id=142, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="但我还是逃跑了，逃离了那个以为是“家”的牢笼。", msg_color="", msg_size=0, talker="梅鹿特", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4502", 0, 0, -129.5, 214.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [142]={next_id=143, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="梅鹿特仰头看向夜空，但泪水还是不争气地夺眶而出，在天台的夜灯下莹莹闪烁。", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [143]={next_id=144, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="后来的事……你都知道啦，我混在了一帮福登城的流浪儿团伙里面，有一次领头的划了一个帮派老大的车，所有人都被抓起来打断了腿。", msg_color="", msg_size=0, talker="梅鹿特", audio="", img="arts/ui/bg/story/storybg_113.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4502", 0, 0, -129.5, 214.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
